INSERT INTO `ncov_msg` VALUES (1, '病毒：SARS-CoV-2，其导致疾病命名COVID-19', '传染源：新冠肺炎的患者。无症状感染者也可能成为传染源。', '传播途径：呼吸道飞沫接触传播是主要的传播途径。气溶胶传播和消化道等传播途径尚未明确。', '易感人群：人群普遍易感。老年人及有基础疾病者感染后病情较重。儿童及婴幼儿也有发病。', '潜伏期：一般为3~7天，最长不超过14天。潜伏期内可能存在传染性。其中无症状病例传染性非常罕见', '宿主：野生动物，可能为中华菊头蝠');
INSERT INTO `news` VALUES (1, 'data:image/jpeg;base64,', '2023年04月11日 14:42', '浙大一院新疗法 突破胰腺癌外科治疗“禁区”', '新华社', '<p style=\"text-indent: 2em;\">新华社客户端浙江频道4月10日电（记者 黄筱）近日，浙江大学医学院附属第一医院肝胆胰外科专家梁廷波带领多学科团队，成功完成该院第46例联合自体小肠移植的胰腺癌根治手术，患者术后恢复顺利，目前已经平安出院。据公开文献资料报道，除浙大一院外，全球范围内开展的此类手术累计只有17例。</p><p style=\"text-indent: 2em;\">这个数字背后，是自2019年以来该团队通过创新的技术方案和完整的技术体系，破解中晚期胰腺癌根治临床难题所取得的成果，也是我国胰腺外科的重大突破之一。</p><p style=\"text-indent: 2em;\">因发病隐匿、治疗手段匮乏、生存期短，胰腺癌被称为“癌中之王”，手术切除是根治胰腺癌的最重要治疗手段，也是患者唯一可能实现长期生存的方法。</p><p style=\"text-indent: 2em;\">然而约一半的胰腺癌初诊患者，因肿瘤浸润性生长的特点，虽然没有远端器官转移，却因局部侵犯、包绕供应小肠的肠系膜上动脉和供应肝脏的肝动脉导致无法手术切除，使得“虽无转移，有如晚期”。因此既往国内外指南均认为此类肿瘤属于不可切除的局部晚期病变。</p><p style=\"text-indent: 2em;\">如何为患者争取到手术的一线希望？如何在对肿瘤根治性切除的同时，保留小肠、肝脏等腹腔重要脏器的血供，从而完整保留其功能？</p><p style=\"text-indent: 2em;\">梁廷波以30余年大器官移植经验和对胰腺癌长期的临床与基础研究为这一问题提供了全新的解决思路。针对中晚期胰腺癌容易侵犯附近动脉、肿瘤切除难度大、治疗手段匮乏的情况，在自行创立的新辅助化疗方案基础上，将自体小肠移植技术和传统的胰腺癌根治切除两大高难度手术相结合，创新建立联合自体小肠移植的胰腺癌根治技术新体系。</p><p style=\"text-indent: 2em;\">同时，利用早年创立的modified FOLFIRNOX化疗方案，“消灭”患者体内的循环肿瘤细胞和全身微转移灶，再将未受肿瘤侵犯的部分肠系膜上动脉血管及其所支配的小肠完整切除并体外灌洗备用；完整切除包含肿瘤的组织后，再将小肠重新“种”回患者体内，并完成消化道重建。</p><p style=\"text-indent: 2em;\">在这项复杂手术技术体系中，浙大一院还全球首创了自体小肠移植联合全胰切除术、自体小肠移植联合胰尾体切除术这两种新术式。</p><p style=\"text-indent: 2em;\">与既往国际报道较高的围术期死亡率（约50%）和较低的术后平均生存期相比（常常不足2个月），梁廷波主刀的患者术后平均存活14.5个月，最长已存活41个月，手术切除率也从既往的15%提升至67%，突破中晚期胰腺癌外科治疗“禁区”，治疗效果和覆盖人群得到前所未有的大幅改善。</p><p style=\"text-indent: 2em;\">目前浙大一院还建立了该技术的全球培训中心，接受海内外外科医生和学者进修学习，为造福更多胰腺癌患者提供技术支撑。多位世界著名胰腺癌领域专家，包括美国科罗拉多大学医院外科主任Richard Shulick、美国约翰·霍普金斯大学胰腺癌精准诊疗中心主任Lei Zheng、美国纽约大学朗格尼健康中心肝胆胰外科主任Christopher Wolfgang、美国胰腺病协会现任主席Min Li等教授，评价其“是一种具有突破性的新型疗法，全世界其他医学中心将会学习这些经验并在合适的胰腺癌患者中应用”，“首次把这一技术规范化、系统化”，为中晚期胰腺癌患者带来了希望。</p>');
INSERT INTO `news` VALUES (2, 'data:image/jpeg;base64,', '2023年04月19日 14:52', '【全国肿瘤防治宣传周】癌症可防可治 重视防癌体检', '中国疾控中心慢病中心', '<p style=\"text-align: justify; text-indent: 2em;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 16px;\">2023 年 4 月 15-21 日是第 29 个<strong>全国肿瘤防治宣传周</strong>。今年宣传周主题是“<strong>癌症防治 全面行动——全人群 全周期 全社会</strong>”。旨在积极倡导每个人做自己健康的第一责任人，正确认识癌症、全民参与防癌抗癌。 &nbsp;</span></p><p style=\"text-align: justify; margin-top: 0px; margin-bottom: 0px; text-indent: 2em;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 16px;\"><strong>癌症是一种慢性病，可防可治</strong>&nbsp;</span></p><p style=\"text-align: justify; margin-top: 0px; margin-bottom: 0px; text-indent: 2em;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 16px;\">癌症的发生是一个长期、慢性、多阶段的过程。从正常细胞演变为癌细胞，再形成危及人体健康的肿瘤，通常需要 10 至 20 年，甚至更长的时间。&nbsp;</span></p><p style=\"text-align: justify; margin-top: 0px; margin-bottom: 0px; text-indent: 2em;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 16px;\">世界卫生组织提出：三分之一的癌症完全可以预防；三分之一的癌症可以通过早期发现得到根治；三分之一的癌症可以运用现有的医疗措施延长生命、减轻痛苦、改善生活质量。&nbsp;</span></p><p style=\"text-align: justify; margin-top: 0px; margin-bottom: 0px; text-indent: 2em;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 16px;\">国际先进经验表明，采取积极预防（如健康教育、控烟限酒、早期筛查等）和规范治疗等措施，对于降低癌症的发病和死亡具有显著效果。&nbsp;</span></p><p style=\"text-align: justify; margin-top: 10px; margin-bottom: 0px; text-indent: 2em;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 16px;\"><strong>癌症不会传染，但是某些致癌微生物具有传染性</strong>&nbsp;</span></p><p style=\"text-align: justify; margin-top: 0px; margin-bottom: 0px; text-indent: 2em;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 16px;\">癌症本身不会直接传染，但有些导致癌症的微生物则有传染性，经常与其接触的人就有被传染的可能性。&nbsp;</span></p><p style=\"text-align: justify; margin-top: 0px; margin-bottom: 0px; text-indent: 2em;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 16px;\">全球有 16.1% 的肿瘤与致病性病原体有关，在发达国家传染性病原体导致的癌症死亡占 6%，而在发展中国家则高达 22%。&nbsp;</span></p><p style=\"text-align: justify; margin-top: 0px; margin-bottom: 0px; text-indent: 2em;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 16px;\">国际癌症研究机构 (IARC) 指出了 11 种/类对人类可以致癌的传染性病原体，包括一种细菌，七种病毒和三个大寄生虫。每一个传染源至少引起一种癌症甚至几种癌症。&nbsp;</span></p><p style=\"text-align: justify; margin-top: 0px; margin-bottom: 0px; text-indent: 2em;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 16px;\">（1）细菌：幽门螺杆菌 (HP)。&nbsp;</span></p><p style=\"text-align: justify; margin-top: 0px; margin-bottom: 0px; text-indent: 2em;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 16px;\">（2）七种病毒：人乳头瘤病毒 (HPV)，乙型肝炎病毒 (HBV)，丙型肝炎病毒 (HCV)，EB 病毒 (EBV)，卡波济肉瘤相关疱疹病毒 (KSHV)，人 T 细胞嗜淋巴细胞病毒-1 型 (HTLV-1) 和艾滋病病毒 (HIV)。&nbsp;</span></p><p style=\"text-align: justify; margin-top: 0px; margin-bottom: 0px; text-indent: 2em;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 16px;\">（3）三种寄生虫：埃及血吸虫，麝后睾吸虫和华支睾吸虫。&nbsp;</span></p><p style=\"text-align: justify; margin-top: 10px; margin-bottom: 0px; text-indent: 2em;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 16px;\"><strong>防癌体检有助癌症早发现</strong>&nbsp;</span></p><p style=\"text-align: justify; margin-top: 0px; margin-bottom: 0px; text-indent: 2em;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 16px;\">防癌体检是早期发现癌症的最重要的途径。专业的防癌体检是代价最小、痛苦最少、最值得提倡的方法。防癌体检，不同于一般的健康体检，特指肿瘤专家结合体检者的自身情况和个体需求，做相应部位的防癌检查。如防肺癌体检，体检时注重肺部 CT 检查；怀疑有胃癌或有高危胃癌家族史的病人，可重点做胃镜检查；肛门指诊是普查直肠癌的简单方法，长期便血或者大便习惯异常者必查。主要推荐的检查项目包括：&nbsp;</span></p><p style=\"text-align:justify;margin-top: 10px; margin-bottom: 0px;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 16px;\">&nbsp;</span></p><table style=\"width: 70%;max-width: 70% !important;box-sizing:border-box;\" width=\"100%\" align=\"center\"><tbody><tr class=\"ue-table-interlace-color-single firstRow\"><td style=\"border-width: 1px; border-style: solid;\" valign=\"center\"><p style=\"text-align:justify;margin-top: 0px; margin-bottom: 0px\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 16px;\"><strong>癌种</strong>&nbsp;</span></p></td><td style=\"border-width: 1px; border-style: solid;\" valign=\"center\"><p style=\"text-align:justify;margin-top: 0px; margin-bottom: 0px\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 16px;\"><strong>检查方法</strong>&nbsp;</span></p></td></tr><tr class=\"ue-table-interlace-color-double\"><td style=\"border-width: 1px; border-style: solid;\" valign=\"center\"><p style=\"text-align:justify;margin-top: 0px; margin-bottom: 0px; \"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 16px;\">肺癌&nbsp;</span></p></td><td style=\"border-width: 1px; border-style: solid;\" valign=\"center\"><p style=\"text-align:justify;margin-top: 0px; margin-bottom: 0px; \"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 16px;\">低剂量螺旋 CT&nbsp;</span></p></td></tr><tr class=\"ue-table-interlace-color-single\"><td style=\"border-width: 1px; border-style: solid;\" valign=\"center\"><p style=\"text-align:justify;margin-top: 0px; margin-bottom: 0px; \"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 16px;\">食管癌/胃癌&nbsp;</span></p></td><td style=\"border-width: 1px; border-style: solid;\" valign=\"center\"><p style=\"text-align:justify;margin-top: 0px; margin-bottom: 0px; \"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 16px;\">上消化道内镜&nbsp;</span></p></td></tr><tr class=\"ue-table-interlace-color-double\"><td style=\"border-width: 1px; border-style: solid;\" valign=\"center\"><p style=\"text-align:justify;margin-top: 0px; margin-bottom: 0px; \"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 16px;\">结直肠癌&nbsp;</span></p></td><td style=\"border-width: 1px; border-style: solid;\" valign=\"center\"><p style=\"text-align:justify;margin-top: 0px; margin-bottom: 0px; \"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 16px;\">大便隐血试验、结肠镜&nbsp;</span></p></td></tr><tr class=\"ue-table-interlace-color-single\"><td style=\"border-width: 1px; border-style: solid;\" valign=\"center\"><p style=\"text-align:justify;margin-top: 0px; margin-bottom: 0px; \"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 16px;\">乳腺癌&nbsp;</span></p></td><td style=\"border-width: 1px; border-style: solid;\" valign=\"center\"><p style=\"text-align:justify;margin-top: 0px; margin-bottom: 0px; \"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 16px;\">乳腺 X 线摄影联合乳腺超声&nbsp;</span></p></td></tr><tr class=\"ue-table-interlace-color-double\"><td style=\"border-width: 1px; border-style: solid;\" valign=\"center\"><p style=\"text-align:justify;margin-top: 0px; margin-bottom: 0px; \"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 16px;\">肝癌&nbsp;</span></p></td><td style=\"border-width: 1px; border-style: solid;\" valign=\"center\"><p style=\"text-align:justify;margin-top: 0px; margin-bottom: 0px; \"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 16px;\">乙型肝炎表面抗原、甲胎蛋白检测、腹部超声&nbsp;</span></p></td></tr><tr class=\"ue-table-interlace-color-single\"><td style=\"border-width: 1px; border-style: solid;\" valign=\"center\"><p style=\"text-align:justify;margin-top: 0px; margin-bottom: 0px; \"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 16px;\">子宫颈癌&nbsp;</span></p></td><td style=\"border-width: 1px; border-style: solid;\" valign=\"center\"><p style=\"text-align:justify;margin-top: 0px; margin-bottom: 0px; \"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 16px;\">细胞学检查、高危型 HPV DNA 检测&nbsp;</span></p></td></tr><tr class=\"ue-table-interlace-color-double\"><td style=\"border-width: 1px; border-style: solid;\" valign=\"center\"><p style=\"text-align:justify;margin-top: 0px; margin-bottom: 0px; \"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 16px;\">鼻咽癌&nbsp;</span></p></td><td style=\"border-width: 1px; border-style: solid;\" valign=\"center\"><p style=\"text-align:justify;margin-top: 0px; margin-bottom: 0px; \"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 16px;\">血清 EB 病毒相关抗体检测、鼻咽纤维镜&nbsp;</span></p></td></tr><tr class=\"ue-table-interlace-color-single\"><td style=\"border-width: 1px; border-style: solid;\" valign=\"center\"><p style=\"text-align:justify;margin-top: 0px; margin-bottom: 0px; \"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 16px;\">前列腺癌&nbsp;</span></p></td><td style=\"border-width: 1px; border-style: solid;\" valign=\"center\"><p style=\"text-align:justify;margin-top: 0px; margin-bottom: 0px; \"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 16px;\">前列腺特异性抗原 (PSA) 检测、直肠指诊、超声&nbsp;</span></p></td></tr><tr class=\"ue-table-interlace-color-double\"><td style=\"border-width: 1px; border-style: solid;\" valign=\"center\"><p style=\"text-align:justify;margin-top: 0px; margin-bottom: 0px; \"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 16px;\">甲状腺癌&nbsp;</span></p></td><td style=\"border-width: 1px; border-style: solid;\" valign=\"center\"><p style=\"text-align:justify;margin-top: 0px; margin-bottom: 0px; \"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 16px;\">超声、甲状腺功能&nbsp;</span></p></td></tr><tr class=\"ue-table-interlace-color-single\"><td style=\"border-width: 1px; border-style: solid;\" valign=\"center\"><p style=\"text-align:justify;margin-top: 0px; margin-bottom: 0px; \"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 16px;\">白血病&nbsp;</span></p></td><td style=\"border-width: 1px; border-style: solid;\" valign=\"center\"><p style=\"text-align:justify;margin-top: 0px; margin-bottom: 0px; \"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 16px;\">血常规、血生化、骨髓穿刺等&nbsp;</span></p></td></tr></tbody></table>');
INSERT INTO `news` VALUES (3, 'data:image/jpeg;base64,', '2023年01月10日 19:44', '叶永安：发挥好中医抗疫的作用', '人民日报海外版', '<p style=\"text-indent: 2em;\">不同的人感染上病毒以后，产生的临床表现是不一样的。中医就是根据这些表现再结合当时的气候、地域情况进行治疗，即“天地人”合参，所以中医不畏惧病毒变异。</p><p style=\"text-indent: 2em;\">当新冠感染患者转为危重症，中医药依然可以发力。这时候需要中西医联手，中西医结合，发挥出“1+1＞2”的效果。</p><p style=\"text-indent: 2em;\">我们前段时间在北京方舱治疗了1000多例轻型患者，用上中药后都取得了很好的效果，降低了转重率。</p><p style=\"text-indent: 2em;\">变异株XBB.1.5是否引起大范围腹泻还属未知。如果新变异株感染表现除呼吸系统外，还以腹泻为主，中医药治疗也会有办法。</p><p style=\"text-indent: 2em;\">当前，新冠病毒感染造成的疫情还在持续。到底该如何认识这轮疫情以及接下来的形势？人们在感染新冠病毒之后如果出现了比较严重的症状，该如何治疗？针对这些热点问题，本报记者专访了北京中医药大学东直门医院主任医师、北京中医药大学肝病研究院院长、原赴武汉国家中医医疗队领队叶永安，请他解疑释惑。</p><p style=\"text-indent: 2em;\"><strong>“天地人”合参，中医不畏惧病毒变异</strong></p><p style=\"text-indent: 2em;\">记者：中医如何看待新冠病毒感染？中医药能否应对、如何应对？</p><p style=\"text-indent: 2em;\">叶永安：纵观中国历史，一部中医史就是一部抗疫史。3000多年来，发生的瘟疫就有500多次。随着病毒的变异，疫情的一波波涌现，我们还需要与新冠病毒继续作斗争。即使新冠病毒消失了，过些年新的病毒还会出现，这不以人类的意志为转移。</p><p style=\"text-indent: 2em;\">几千年来，中医一直庇护着中华民族。人类正是在长期与疾病（包括病毒）做斗争的过程中成长和壮大起来的。不同的人感染上病毒以后，产生的临床表现是不一样的。中医就是根据这些表现再结合当时的气候、地域情况进行治疗，即“天地人”合参，所以中医不畏惧病毒变异。</p><p style=\"text-indent: 2em;\">历史经验告诉我们，中医也是在不断与疾病尤其是与疫病（即传染病）做斗争的过程中形成经验而传承和发展下来的，说明面对病毒中医可以应对，也能够应对。武汉抗疫是中医及中西医结合抗击疫情的一次生动实践，已经过去近3年了，其中很多经验值得回顾与借鉴，当然，还要结合现在的“天地人”的变化而作相应的调整，这也是中医取得疗效的根本之所在。</p><p style=\"text-align: center;\" class=\"photo_img_20190808\"></p><p style=\"text-indent: 2em;\"><strong>若发病早期就用上中药，不少人可以避免白肺</strong></p><p style=\"text-indent: 2em;\">记者：我们看到，有患者出现白肺现象，这是怎么造成的？中医药如何进行针对性治疗？很多人“阳康”之后产生乏力、咳嗽不断、睡眠差等症状，这是否是新冠感染的后遗症？该如何调理以防止后遗症的困扰？</p><p style=\"text-indent: 2em;\">叶永安：当肺部的炎症比较重，渗出比较多的时候，也就是肺的白色影像区域面积达到了70%、80%，在临床上俗称为白肺，一般高龄合并有严重基础疾病的患者可能会出现。如果在发病早期就用上中药，不少人是可以避免的，或者即使发生也会比较轻。关键是尽早发现，在医生的指导下及时准确用药。</p><p style=\"text-indent: 2em;\">实际上，从国家层面到各省市都有一些中医治疗的指导意见出台，是可以参照使用的，关键是患者与大夫的及时对接。处理好轻症居家、重症到医院的关系，既不要造成医疗资源挤兑，也不能耽误重症救治。</p><p style=\"text-indent: 2em;\">一些人“阳康”之后产生乏力、咳嗽不断、睡眠差等症状，这是病毒感染造成人体的伤害，有一个恢复的过程。做到起居有时、饮食有节、避免过劳，一般在短时间内能够恢复。症状偏重一点的，在确认肺部及其他脏器检查正常情况下，可以服一些中药帮助恢复。</p><p style=\"text-indent: 2em;\"><strong>基本病理机制不变，中医就可维持原治疗方案</strong></p><p style=\"text-indent: 2em;\">记者：有患者在“阳康”一段时间后又“复阳”了，中医药有没有办法防止这种情况的出现？面对新冠病毒毒株不断变异的情况，中医药如何应对？怎样随时调整？“三药三方”是否还管用？能否对不同地区不同毒株混杂传播的局面来个“一揽子解决”？</p><p style=\"text-indent: 2em;\">叶永安：“复阳”指感染者症状基本消失，核酸或抗原检测阴性了之后，再次检测又发现阳性了。一般认为这时检出的是一些病毒的片段，并不是完整的病毒。一般的复阳都是发生在康复之后一个月内。如果已经超过一个月，核酸又呈阳性，再感染的可能性就比较大。如果是再感染了，中医药也可以治疗。前面说到中医治病是治疗感染病毒的人，不管病毒怎么变，中医都能辨证施治。</p><p style=\"text-indent: 2em;\">因时、因地、因人制宜，基本病理机制不变，中医就可以维持原治疗方案。若基本病理机制变了，就要因时因人而变。据此，“三药三方”可以继续使用，但对于一些重症患者要根据具体情况由医生来研判。依据这样的基本思路，对不同地区不同毒株混杂传播的局面应进行辨证施治。</p><p style=\"text-indent: 2em;\"><strong>老人一有发热咳嗽症状，要尽早用上中药</strong></p><p style=\"text-indent: 2em;\">记者：目前的疫情给有基础病的老年人造成威胁。该如何保护这个脆弱的群体？</p><p style=\"text-indent: 2em;\">叶永安：我们看到目前的疫情给有基础病的老年人造成了威胁，尤其是未完成疫苗接种的人群。</p><p style=\"text-indent: 2em;\">对居家且有基础病的老年人，首先平时要控制好基础病，感染后要密切观察。因为老年人往往症状表现不明显，如发热不是很高，并不代表病情不重，一有发热咳嗽症状要尽早用上中药，同时密切跟踪患者病情变化，如果病情持续加重就要到医院救治。如果及时用药，属轻症的老年人不少是能够居家平稳渡过难关的，关键在一个“早”字。需要提醒的是，部分老年人病情刚恢复时，要注意避免劳累、保持好睡眠、注意营养，防止病还未痊愈，又合并其他感染而致病情突然加重，这也是近期一些老年人出现意外的原因之一。</p><p style=\"text-indent: 2em;\"><strong>遇到危重症患者，要发挥好中西医结合作用</strong></p><p style=\"text-indent: 2em;\">记者：犹记得3年前武汉抗击疫情时，中医药发挥了重要作用。中医治疗还被引入了重症监护病房。当时的经验是在一个城市取得的，是否适用于更大范围感染的现实？如何让中医药发挥救治危重症患者的作用？</p><p style=\"text-indent: 2em;\">叶永安：三年前的武汉保卫战，中医药无论在轻型、普通型、重症还是危重症的治疗上都发挥了应有的作用，尽管当时的经验是在武汉这一个城市取得的，其基本思路和方法是能够应用到更大范围感染的现实中去。据我所知，参加武汉抗疫的医务人员在近3年的北京疫情防控中都发挥了骨干作用，其他地方也是这样。</p><p style=\"text-indent: 2em;\">武汉的经验告诉我们，当新冠病毒感染患者转为危重症，中医药依然可以发力。这时候需要中西医联手，中西医结合，发挥出“1+1＞2”的效果。</p><p style=\"text-indent: 2em;\">3年前，我们在武汉通过中西医联手抢救过来的危重症年逾80岁的患者，至今依然恢复良好。如果遇到危重症患者，中医药要积极参与，最大限度发挥好中医药这一民族瑰宝的作用，发挥出中医药治病救人的独特作用。</p><p style=\"text-indent: 2em;\"><strong>形成中西医结合的良好氛围，发挥出抗疫的中国特色</strong></p><p style=\"text-indent: 2em;\">记者：中西医结合、中西药并用，是中国疫情防控的一大特点，也是中医药传承精华、守正创新的生动实践。在接下来的疫情防控中，如何进一步推进中西医结合、中西药并用？</p><p style=\"text-indent: 2em;\">叶永安：在接下来的疫情防控中，老年人和儿童的轻型患者是重点，要尽快用上中药，防止转成重症，将重症发生率尽可能降下来，从而进一步降低病亡率。我们前段时间在北京方舱治疗了1000多例轻型患者，用上中药后都取得了很好的效果，降低了转重率。</p><p style=\"text-indent: 2em;\">对于一些重症尤其是危重症患者，可采用中西医结合、中西药并用，最大限度去救治患者。武汉抗疫以及后来的多地抗疫应用中医药的经验，已充分说明中医药在疫情防控中的重要作用。</p><p style=\"text-indent: 2em;\">当前，进一步深化中西医结合“四有”机制，发挥出抗疫的中国特色。中医药人更要有使命担当的精神，勇于实践，更好地发挥出中医药的作用，为接下来的疫情防控作出应有的贡献。</p><p style=\"text-indent: 2em;\"><strong>面对奥密克戎变异株，中医药依然可以发挥作用</strong></p><p style=\"text-indent: 2em;\">记者：新冠病毒奥密克戎的变异株（XBB.1.5）出现新的病患特点，中医有什么应对措施？</p><p style=\"text-indent: 2em;\">叶永安：我们前面提到，无论病毒怎么变异，中医药都有应对之策，重要的是我们要抓住新冠病毒感染人的核心病机予以施治。</p><p style=\"text-indent: 2em;\">实际上，3年来新冠病毒在中医主要表现以“湿毒”为主，不同的变异株在不同年份、不同季节及不同地域表现出兼夹“风、寒、燥”或者化热的不同特点，但其湿毒主要侵犯中医的肺、脾两脏，以肺为主，临床可表现为咳嗽、咽痛等呼吸系统症状外，还可以表现为恶心、腹泻等消化系统症状，不同的变异株表现特点会有所不同。尽管有报道称新冠病毒可以侵犯全身多个脏器，但还是以这两个系统表现为主。</p><p style=\"text-indent: 2em;\">变异株XBB.1.5是否引起大范围腹泻还属未知。如果新变异株感染表现除呼吸系统外，还以腹泻为主，中医药治疗也会有办法，如腹泻属外有表证、里有热邪的可选用“葛根芩连汤”、脾虚为主的可选用“参苓白术丸”，若外有寒邪、内有湿滞的也可选用“藿香正气”系列等。总之，只要在大夫指导下选择好用药，我们完全能够应对新的变异株。</p>');
INSERT INTO `news` VALUES (4, 'data:image/jpeg;base64,', '2022年12月22日 15:06', '新型冠状病毒阳性感染者中医调护指南', '央视网', '<p style=\"text-align: justify; text-indent: 2em; margin-bottom: 5px; margin-top: 5px; line-height: 1.75em;\">本指南用于帮助新型冠状病毒阳性感染者（含核酸阳性或抗原阳性，以下简称阳性感染者）正确进行自我调护，促进身体康复。当您新冠病毒核酸检测阳性或者自测抗原阳性，出现了咳嗽、乏力、便秘等症状时，您可以阅读本指南获得相应的中医调护方法。</p><p style=\"text-align: left; text-indent: 2em; margin-bottom: 5px; margin-top: 5px; line-height: 1.75em;\">您可以依据自身症状，采取相应的中医调护方法。</p><p style=\"text-align: center; text-indent: 2em; margin-bottom: 5px; margin-top: 5px; line-height: 1.75em;\"><strong>一、改良八段锦<br></strong></p><p style=\"text-align: justify; text-indent: 2em; margin-bottom: 5px; margin-top: 5px; line-height: 1.75em;\"><strong>简介：</strong> <br></p><p style=\"text-align: justify; text-indent: 2em; margin-bottom: 5px; margin-top: 5px; line-height: 1.75em;\">八段锦等导引术是中国传统的运动疗法，八段锦有平衡阴阳、调理脏腑、增强体质之效，在新型冠状病毒肺炎的防治中，对患者的正气恢复有协同作用，通过协调动作调动全身，达到扶持正气，疏通经络，调和脏腑的作用，进而起到强健身体、畅通气血的效果，有助于恢复体能，增强人体免疫力。改良八段锦即以传统八段锦为基础，优选传统导引功法用于乏力、睡眠障碍、情志失调、便秘等不适症状的辅助调养，对康复期的乏力、疲倦、活动后气短等也有改善作用。 <br></p><p style=\"text-align: justify; text-indent: 2em; margin-bottom: 5px; margin-top: 5px; line-height: 1.75em;\"><strong>运动方式：</strong></p><p style=\"text-align: justify; text-indent: 2em; margin-bottom: 5px; margin-top: 5px; line-height: 1.75em;\">健身气功·八段锦8节（一套）+传统功法2节</p><p style=\"text-align: justify; text-indent: 2em; margin-bottom: 5px; margin-top: 5px; line-height: 1.75em;\">您可以根据主要不适症状选择相应的2节传统功法：①如您没有明显症状，您可选择吕仁和十八段锦-捶打肩井一斗米利肺气、吕仁和十八段锦-捶打大椎至阳穴升阳气；②如您出现睡眠障碍，您可选择苏学良养生六法-强心功、苏学良养生六法-理气。③如您出现便秘，您可选择仙人摩腹法、回头顾踵。④如您出现情绪失调，您可选择吕仁和十八段锦-左右打压利肝脾、苏学良养生六法-弯弓射虎。⑤如您出现乏力，您可选择捶打丹田补元气、双手捶天提神气。</p><p style=\"text-align: justify; text-indent: 2em; margin-bottom: 5px; margin-top: 5px; line-height: 1.75em;\"><strong>运动时间：</strong><br></p><p style=\"text-align: justify; text-indent: 2em; margin-bottom: 5px; margin-top: 5px; line-height: 1.75em;\">每天10时或16-17时，每次30分钟（热身5分钟+八段锦12分钟+传统功法8分钟+拉伸放松5分钟）。</p><p style=\"text-align: justify; text-indent: 2em; margin-bottom: 5px; margin-top: 5px; line-height: 1.75em;\"><strong>运动频率：</strong></p><p style=\"text-align: justify; text-indent: 2em; margin-bottom: 5px; margin-top: 5px; line-height: 1.75em;\">每日1次。 <br></p><p style=\"text-align: justify; text-indent: 2em; margin-bottom: 5px; margin-top: 5px; line-height: 1.75em;\"><strong>运动强度</strong>：</p><p style=\"text-align: justify; text-indent: 2em; margin-bottom: 5px; margin-top: 5px; line-height: 1.75em;\">根据您自身感觉，以微汗为宜，应避免运动量过大、动作速度过快，注意动作的连贯性和稳定性。&nbsp; <br></p><p style=\"text-align: center; text-indent: 2em; margin-bottom: 5px; margin-top: 5px; line-height: 1.75em;\"><strong>二、中医情志调护——五音疗法</strong> <br></p><p style=\"text-align: justify; text-indent: 2em; margin-bottom: 5px; margin-top: 5px; line-height: 1.75em;\"><strong>简介：</strong> <br></p><p style=\"text-align: justify; text-indent: 2em; margin-bottom: 5px; margin-top: 5px; line-height: 1.75em;\">中医的五音疗法是音乐治疗中独特的一门疗法。作为情志护理手段，是一种非药物的绿色疗法，尤其对缓解精神紧张有显著效果，可明显改善患者抑郁和焦虑状态，提升患者就医体验。它是通过五音调式的“宫（DO）商（RE）角（MI）徵（SOL）羽（LA）”与人的五脏“脾肺肝心肾”与五行“土金木火水”相对应。利用五行的生化制克来治疗疾病。 <br></p><p style=\"text-align: justify; text-indent: 2em; margin-bottom: 5px; margin-top: 5px; line-height: 1.75em;\"><strong>功效：</strong></p><p style=\"text-align: justify; text-indent: 2em; margin-bottom: 5px; margin-top: 5px; line-height: 1.75em;\">肺对应商调式，五行为金，金石类材料制造的乐器演奏的商调式音乐，气势磅礴、高昂，起伏委婉，震荡心肺，可调节呼吸功能，增强卫气，扶正固表，提高患者抵御疾病的能力。每日16:00-19:00期间，至少聆听1小时，3小时最佳。找一个舒服姿势，感受自己的身体每一处，放松全身肌肉，跟随音乐的节奏调整呼吸。也可做自己想做的事情，将乐曲作为背景音乐。 <br></p><p style=\"text-align: justify; text-indent: 2em; margin-bottom: 5px; margin-top: 5px; line-height: 1.75em;\">肝对应角调式，五行同属木，角调式音乐的特点是流畅舒展、清新悠扬，需要疏肝者可通过聆听音乐强化肝脏功能，疏肝理气，防治气的内郁，有助于舒缓焦虑，缓解抑郁；睡前听，配合呼吸调整，有助于稳定心神，达到安神作用。每日睡前聆听1小时，21:00-24:00期间，睡前2小时避免大强度运动。闭眼，找一个舒服的姿势，放松全身肌肉，跟随音乐的节奏调整呼吸，专注听音乐。 <br></p><p style=\"text-align: center; text-indent: 2em; margin-bottom: 5px; margin-top: 5px; line-height: 1.75em;\"><strong>三、六字诀呼吸操</strong> <br></p><p style=\"text-align: justify; text-indent: 2em; margin-bottom: 5px; margin-top: 5px; line-height: 1.75em;\"><strong>简介：</strong> <br></p><p style=\"text-align: justify; text-indent: 2em; margin-bottom: 5px; margin-top: 5px; line-height: 1.75em;\">“六字诀” 是一种“以鼻纳气、以口吐气”的呼吸吐纳功法，是临床上应用最多的中医肺康复训练方法之一，它是一种利用唇齿喉舌用力不同的吐气发声法，主要通过“嘘、呵、呼、呬、吹、 嘻”六字发音以牵动不同脏腑经络气血的运行来强化人体组织机能，抵抗疾病侵袭，调理脏腑经络。</p><p style=\"text-align: justify; text-indent: 2em; margin-bottom: 5px; margin-top: 5px; line-height: 1.75em;\"><strong>功效：</strong></p><p style=\"text-align: justify; text-indent: 2em; margin-bottom: 5px; margin-top: 5px; line-height: 1.75em;\">“健身气功·六字诀”具有调和五脏、疏通经络、平秘阴阳的功效。既往研究证实“六字诀”训练不仅能明显改善患者肺通气功能，减少咳嗽咳痰量，改善运动耐力等，还能起到调整患者身心状态，促进生活质量提高的效果。 <br></p><p style=\"text-align: justify; text-indent: 2em; margin-bottom: 5px; margin-top: 5px; line-height: 1.75em;\"><strong>锻炼方法： </strong><br></p><p style=\"text-align: justify; text-indent: 2em; margin-bottom: 5px; margin-top: 5px; line-height: 1.75em;\">请按国家体育总局颁布的 “健身气功·六字诀”视频指导进行锻炼。分别发出“嘘、呵、呼、呬、吹、嘻”的声音，六字循序进行。 <br></p><p style=\"text-align: justify; text-indent: 2em; margin-bottom: 5px; margin-top: 5px; line-height: 1.75em;\"><strong>时间及频率：</strong></p><p style=\"text-align: justify; text-indent: 2em; margin-bottom: 5px; margin-top: 5px; line-height: 1.75em;\">每日30分钟，可分3-5次根据自身情况完成。避免饭后1小时内锻炼。</p><p style=\"text-align: justify; text-indent: 2em; margin-bottom: 5px; margin-top: 5px; line-height: 1.75em;\">进行“六字诀”训练时，不要求准确普通话发音，而应该根据拼音发声吐气，避免用力呼吸，训练中禁止憋气；锻炼时应遵循安全第一的原则，应根据个人情况循序渐进锻炼，若出现任何不适应立即终止训练，并联系医护人员。</p><p style=\"text-align: center; text-indent: 2em; margin-bottom: 5px; margin-top: 5px; line-height: 1.75em;\"><strong>四 、穴位按摩及循经拍打</strong> <br></p><p style=\"text-align: justify; text-indent: 2em; margin-bottom: 5px; margin-top: 5px; line-height: 1.75em;\"><strong>简介： </strong><br></p><p style=\"text-align: justify; text-indent: 2em; margin-bottom: 5px; margin-top: 5px; line-height: 1.75em;\">穴位按摩和循经拍打是传统的中医护理操作技术，通过刺激体表穴位，沿着经络传导至脏腑，达到疏通经络、宣通气血、调理脏腑的作用。通过对特定穴位和经络的刺激，可以有效改善便秘症状。</p>');
INSERT INTO `news` VALUES (5, 'data:image/jpeg;base64,', '2022年07月11日 17:27', '健康中国行动 专项行动一：健康知识普及行动', '国家卫生健康委', '<p style=\"text-indent: 2em;\">每个人是自己健康的第一责任人，对家庭和社会都负有健康责任。普及健康知识，提高全民健康素养水平，是提高全民健康水平最根本最经济最有效的措施之一。当前，我国居民健康素养水平总体仍比较低。2017年居民健康素养水平只有14.18%。城乡居民关于预防疾病、早期发现、紧急救援、及时就医、合理用药、应急避险等维护健康的知识和技能比较缺乏，不健康生活行为方式比较普遍。科学普及健康知识，提升健康素养，有助于提高居民自我健康管理能力和健康水平。《中国公民健康素养——基本知识与技能》界定了现阶段健康素养的具体内容，是公民最应掌握的健康知识和技能。</p><p style=\"text-indent: 2em;\"><strong>行动目标：</strong></p><p style=\"text-indent: 2em;\">到2022年和2030年，全国居民健康素养水平分别不低于22%和30%，其中：基本知识和理念素养水平、健康生活方式与行为素养水平、基本技能素养水平分别提高到30%、18%、20%及以上和45%、25%、30%及以上，居民基本医疗素养、慢性病防治素养、传染病防治素养水平分别提高到20%、20%、20%及以上和28%、30%、25%及以上；人口献血率分别达到15‰和25‰；建立并完善健康科普专家库和资源库，构建健康科普知识发布和传播机制；中央广电总台对公益性健康节目和栏目，在时段、时长上给予倾斜保障；建立医疗机构和医务人员开展健康教育和健康促进的绩效考核机制；医务人员掌握与岗位相适应的健康科普知识，并在诊疗过程中主动提供健康指导；中医医院设置治未病科室比例分别达到90%和100%。鼓励各主要媒体网站和商业网站开设健康科普栏目。提倡个人定期记录身心健康状况；了解掌握基本中医药健康知识；掌握基本的急救知识和技能。</p><p style=\"text-indent: 2em;\"><strong>——个人和家庭：</strong></p><p style=\"text-indent: 2em;\">1、正确认识健康。健康包括身体健康、心理健康和良好的社会适应能力。遗传因素、环境因素、个人生活方式和医疗卫生服务是影响健康的主要因素。每个人是自己健康的第一责任人，提倡主动学习健康知识，养成健康生活方式，自觉维护和促进自身健康，理解生老病死的自然规律，了解医疗技术的局限性，尊重医学和医务人员，共同应对健康问题。</p><p style=\"text-indent: 2em;\">2、养成健康文明的生活方式。注重饮食有节、起居有常、动静结合、心态平和。讲究个人卫生、环境卫生、饮食卫生，勤洗手、常洗澡、早晚刷牙、饭后漱口，不共用毛巾和洗漱用品，不随地吐痰，咳嗽、打喷嚏时用胳膊或纸巾遮掩口鼻。没有不良嗜好，不吸烟，吸烟者尽早戒烟，少喝酒，不酗酒，拒绝毒品。积极参加健康有益的文体活动和社会活动。关注并记录自身健康状况，定期健康体检。积极参与无偿献血，健康成人每次献血400ml不影响健康，还能帮助他人，两次献血间隔不少于6个月。</p><p style=\"text-indent: 2em;\">3、关注健康信息。学习、了解、掌握、应用《中国公民健康素养——基本知识与技能》和中医养生保健知识。遇到健康问题时，积极主动获取健康相关信息。提高理解、甄别、应用健康信息的能力，优先选择从卫生健康行政部门等政府部门及医疗卫生专业机构等正规途径获取健康知识。</p><p style=\"text-indent: 2em;\">4、掌握必备的健康技能。会测量体温、脉搏；能够看懂食品、药品、化妆品、保健品的标签和说明书；学会识别常见的危险标识，如高压、易燃、易爆、剧毒、放射性、生物安全等，远离危险物。积极参加逃生与急救培训，学会基本逃生技能与急救技能；需要紧急医疗救助时拨打120急救电话；发生创伤出血量较多时，立即止血、包扎；对怀疑骨折的伤员不要轻易搬动；遇到呼吸、心脏骤停的伤病员，会进行心肺复苏；抢救触电者时，首先切断电源，不能直接接触触电者；发生火灾时，会拨打火警电话119，会隔离烟雾、用湿毛巾捂住口鼻、低姿逃生。应用适宜的中医养生保健技术方法，开展自助式中医健康干预。</p><p style=\"text-indent: 2em;\">5、科学就医。平时主动与全科医生、家庭医生联系，遇到健康问题时，及时到医疗机构就诊，早诊断、早治疗，避免延误最佳治疗时机。根据病情和医生的建议，选择合适的医疗机构就医，小病诊疗首选基层医疗卫生机构，大病到医院。遵医嘱治疗，不轻信偏方，不相信“神医神药”。</p><p style=\"text-indent: 2em;\">6、合理用药。遵医嘱按时、按量使用药物，用药过程中如有不适及时咨询医生或药师。每次就诊时向医生或药师主动出示正在使用的药物记录和药物过敏史，避免重复用药或者有害的相互作用等不良事件的发生。服药前检查药品有效期，不使用过期药品，及时清理家庭中的过期药品。妥善存放药品，谨防儿童接触和误食。保健食品不是药品，正确选用保健食品。</p><p style=\"text-indent: 2em;\">7、营造健康家庭环境。家庭成员主动学习健康知识，树立健康理念，养成良好生活方式，互相提醒定期体检，优生优育，爱老敬老，家庭和谐，崇尚公德，邻里互助，支持公益。有婴幼儿、老人和残疾人的家庭主动参加照护培训，掌握有关护理知识和技能。提倡有经消化道传播疾病的患者家庭实行分餐制。有家族病史的家庭，有针对性地做好预防保健。配备家用急救包（含急救药品、急救设备和急救耗材等）。</p><p style=\"text-indent: 2em;\"><strong>——社会和政府：</strong></p><p style=\"text-indent: 2em;\">1、建立并完善健康科普“两库、一机制”。建立并完善国家和省级健康科普专家库，开展健康科普活动。中央级媒体健康科普活动的专家应从国家科普专家库产生，省级媒体应从省级以上科普专家库产生。建立并完善国家级健康科普资源库，出版、遴选、推介一批健康科普读物和科普材料。针对重点人群、重点健康问题组织编制相关知识和信息指南，由专业机构向社会发布。构建全媒体健康科普知识发布和传播的机制，加强对健康教育内容的指导和监管，依托专业力量，加强电视、报刊健康栏目和健康医疗广告的审核和监管，以及对互联网新媒体平台健康科普信息的监测、评估和通报。对于出现问题较多的健康信息平台要依法依规勒令整改，直至关停。对于科学性强、传播效果好的健康信息，予以推广。对于传播范围广、对公众健康危害大的虚假信息，组织专家予以澄清和纠正。</p><p style=\"text-indent: 2em;\">2、医务人员掌握与岗位相适应的健康科普知识，并在诊疗过程中主动提供健康指导。各医疗机构网站要根据本机构特色设置健康科普专栏，为社区居民提供健康讲座和咨询服务，三级医院要组建健康科普队伍，制定健康科普工作计划，建设微博微信新媒体健康科普平台。开发健康教育处方等健康科普材料，定期面向患者举办针对性强的健康知识讲座。完善全科医生、专科医生培养培训课程和教材内容，显著提高家庭医生健康促进与教育必备知识与技能。深入实施中医治未病健康工程，推广普及中医养生保健知识和易于掌握的中医养生保健技术和方法。鼓励健康适龄的公民定期参加无偿献血。</p><p style=\"text-indent: 2em;\">3、建立鼓励医疗卫生机构和医务人员开展健康促进与教育的激励约束机制，调动医务人员参与健康促进与教育工作的积极性。将健康促进与教育工作纳入各级各类医疗机构绩效考核，纳入医务人员职称评定和绩效考核。完善医保支付政策，鼓励基层医疗机构和家庭签约医生团队开展健康管理服务。鼓励和引导个人践行健康生活方式，加强个人健康管理。</p><p style=\"text-indent: 2em;\">4、鼓励、扶持中央广电总台和各省级电台、电视台在条件成熟的情况下开办优质健康科普节目。中央广电总台对公益性健康节目和栏目，在时段、时长上给予倾斜保障，继续办好现有数字付费电视健康频道。报刊推出一批健康专栏。运用“两微一端”（指微信、微博、移动客户端）以及短视频等新媒体，推动“互联网+精准健康科普”。</p><p style=\"text-indent: 2em;\">5、动员更多的社会力量参与健康知识普及工作。鼓励卫生健康行业学会、协会组织专家开展多种形式的、面向公众的健康科普活动和面向机构的培训工作。各社区和单位要将针对居民和职工的健康知识普及作为一项重要工作，结合居民和职工的主要健康问题，组织健康讲座等健康传播活动。加强贫困地区人口的健康素养促进工作。</p><p style=\"text-indent: 2em;\">6、开发推广健康适宜技术和支持工具。发挥市场机制作用，鼓励研发推广健康管理类人工智能和可穿戴设备，充分利用互联网技术，在保护个人隐私的前提下，对健康状态进行实时、连续监测，实现在线实时管理、预警和行为干预，运用健康大数据提高大众自我健康管理能力。</p><p style=\"text-indent: 2em;\">7、开展健康促进县（区）建设，着力提升居民健康素养。国家每年选择一个与群众密切相关的健康主题开展“健康中国行”宣传教育活动。开展“中医中药中国行”活动，推动中医药健康文化普及，传播中医养生保健知识。推进全民健康生活方式行动，强化家庭和高危个体健康生活方式指导和干预。</p><p style=\"text-indent: 2em;\">【摘自：2019年7月9日，健康中国行动推进委员会印发的《健康中国行动（2019-2030年）》】<br></p>');
INSERT INTO `news` VALUES (6, 'data:image/jpeg;base64,', '2022年06月27日 16:11', '远离颈椎病 三法巧防治', '中国中医药报', '<p style=\"text-indent: 2em;\">当今社会，“手机族”的队伍正在壮大，天天低头看手机不仅影响人与人之间的交流，还严重影响自身健康，颈椎病就是其引发的最常见的一种疾病。</p><p style=\"text-indent: 2em;\">从中医角度看，颈椎病属于“项痹”“痿证”“项强”“眩晕”等范畴。中医认为，颈椎病是在内外致病因素的共同作用下，机体气血瘀滞，经络痹阻不畅，“不通则痛”，随之出现的一系列临床症状。</p><p style=\"text-indent: 2em;\">现代医学认为，颈椎病是由于颈椎间盘退化，间隙变窄，骨质增生，从而刺激或压迫颈椎神经根、脊髓、椎动脉或交感神经等组织，引起相应的临床症状，是一种常见病。长时间低头，颈腰椎后方的肌肉反复牵拉，造成肌肉的痉挛，局部出现充血、水肿，形成无菌性炎症，时间长了，就成了颈椎病。研究发现，低头的角度越大，颈椎承受的力量越大。颈部过度前倾，对颈椎肌肉产生牵扯，颈椎韧带、肌肉紧张，影响颈部血液循环，造成颈部肌肉劳损。颈椎的生理弯曲拉直甚至变成向前歪曲，这种变化被称为“反弓”。颈椎反弓后会改变颈椎正常受力情况，加速颈椎间盘的退变，严重时颈椎椎体向前挤压，椎间盘被迫向后方或侧方突出，从而压迫神经，产生系列症状。</p><p style=\"text-indent: 2em;\">颈椎病依据症状可分为五型，其中落枕型颈椎病以颈部症状为主，相当于西医颈型颈椎病，是临床最常见的类型，以颈部痛、胀及不适感为主，常在清晨醒后出现，或起床时发觉抬头困难，约半数以上患者颈部活动受限或强迫体位，活动时疼痛加剧，休息可得缓解。</p><p style=\"text-indent: 2em;\"><strong>颈部练功</strong></p><p style=\"text-indent: 2em;\">建议每低头工作1-2小时后就适当走动并活动颈椎，平时可多做做清宫正骨流派的练功法。</p><p style=\"text-indent: 2em;\">动作一：与项争力</p><p style=\"text-indent: 2em;\">动作要点：保持坐位，双手叉腰，上身不动，头尽量后仰，同时深吸气，此时颈部前屈肌群紧张对抗，然后复原，同时呼气。低头，闭口，下颌尽量紧贴前胸，同时呼气，颈部后伸肌群对抗用力，然后复原，同时吸气。本法反复10次。</p><p style=\"text-indent: 2em;\">动作二：哪吒探海</p><p style=\"text-indent: 2em;\">动作要点：保持坐位，双足分开，与肩同宽，双手叉腰；头颈用力伸向左前方，双目注视前方地面约1.5厘米处；身体不动，颈部继续努力向前探伸同时吸气，然后还原，同时呼气。同样的动作再做一次，这次头颈用力伸向右前方。左右各做10次。</p><p style=\"text-indent: 2em;\">动作三：回头望月</p><p style=\"text-indent: 2em;\">动作要点：保持坐位，双腿略分开，两手叉腰，上身前倾，头及上身用力左转，头后探，右肩略下沉，左肩微耸，如回首望月，同时深吸气，然后还原，呼气。同样的动作再做一次，这次头及上身用力右转，头后探，左肩略下沉，右肩微耸。左右各做10次。</p><p style=\"text-indent: 2em;\"><strong>穴位按摩</strong></p><p style=\"text-indent: 2em;\">按揉大椎穴：四指并拢放于上背部大椎穴处，用力反复按摩20-30次，至局部发热为佳，具有疏风散寒、活血通络的作用。</p><p style=\"text-indent: 2em;\">按揉风池穴：用两手拇指分别按两侧风池穴，其余手指附在头的两侧，由轻到重，按揉20-30次，以局部有酸胀感为佳，具有疏风散寒、开窍镇痛的作用。</p><p style=\"text-indent: 2em;\">按揉肩井穴：被按摩者取坐位，按摩者站于其身后，用双手拇指按压肩井穴约1分钟，然后按揉约2分钟，以局部酸胀感为佳。</p><p style=\"text-indent: 2em;\">按揉百会穴：百会穴位于头顶正中央，两耳尖连线中点处，用中指或食指按压，一般以局部有酸麻的感觉最好，用力由轻到重，按揉20-30次，具有健脑宁神、益气固托的作用。</p><p style=\"text-indent: 2em;\">此外，还可拿揉颈肌、斜方肌、胸锁乳突肌、肩背部及患肢肌肉，力量适度，从上至下做2-3遍，能起到解痉止痛的作用。</p><p style=\"text-indent: 2em;\"><strong>生活习惯 </strong><br></p><p style=\"text-indent: 2em;\">对于上班族来说，应避免长时间低头工作，不要趴在桌子上睡觉，这两种姿势颈椎会过度屈曲，腰椎也处在屈曲受力状态，极易造成肌肉疲劳和缺血，加速颈椎病变。 <br></p><p style=\"text-indent: 2em;\">女性应避免长期穿高跟鞋，否则会导致身体重心前移，机体需要通过挺胸、抬头、翘臀，增加整个脊柱S形弯曲来适应，久而久之，会导致脊柱后侧肌肉韧带如颈项部、胸背部、下腰部等椎旁肌肉疲劳和劳损，诱发颈肩痛。 <br></p><p style=\"text-indent: 2em;\">枕头选择应符合颈椎生理曲度，硬度适中，透气性好，以中间低、两端高的“元宝形”为好，高度以让整个脊柱中轴在一条曲线上为最好。 <br></p><p style=\"text-indent: 2em;\">除此之外，应注意颈部保暖，防止风寒侵袭，吹冷风或受凉会让颈部毛细血管收缩，导致血液运输受阻，引起颈部不适。</p><p style=\"text-indent: 0em;\">（作者：张清，主任医师、教授、博士生导师，中国中医科学院望京医院医务处处长，入选首批中国中医科学院“中青年名中医”。）</p>');
INSERT INTO `news` VALUES (7, 'data:image/jpeg;base64,', '2022年06月16日 13:20', '常念六个字 养出好五脏', '中国中医药报', '<p style=\"text-align: center;\">春嘘明目本扶肝，夏至呵心火自闲。 <br></p><p style=\"text-align: center;\">秋呬定收金肺润，冬吹肾水得平安。 <br></p><p style=\"text-align: center;\">三焦嘻却除烦热，四季常呼脾化餐。 <br></p><p style=\"text-align: center;\">切忌出声闻口耳，其功尤胜保身丹。</p><p style=\"text-indent: 2em;\">“嘘、呵、呬、吹、嘻、呼”六字诀养生法，是我国古代流传下来的一种养生方法。六字诀为吐纳法，通过六字的不同发音口型，唇齿喉舌的用力不同，以牵动不同的脏腑经络气血的运行。</p><p style=\"text-indent: 2em;\">两手放于腰间，向左旋转腰部，伸出右手向前伸，念“嘘”字，这时要注意眼睛看着手掌。然后，手慢慢收回到腰间，再向右转，伸出左手念“嘘”字，最后复位。反复做6次，每天2组。 <br></p><p style=\"text-indent: 2em;\">作用：“嘘”字诀主要是疏肝理气、清肝明目。</p><p style=\"text-indent: 2em;\">足大趾轻轻点地，两手掌心向里由小腹前抬起，经体前至胸部两乳中间位置向外翻掌，上托至眼部，嘴说“呵”。呼气尽吸气时，翻转手心向面，经面前、胸腹缓缓下落，垂于体侧，再行第二次吐字。6次为一遍，做一次调息。 <br></p><p style=\"text-indent: 2em;\">作用：“呵”字诀可改善心悸、心绞痛、失眠、健忘、盗汗等疾患。</p><p style=\"text-indent: 2em;\">两腿分开与肩同宽，两手在肚脐前逐渐向上抬到乳腺位置，然后立掌夹肘，仰头缩项，使劲往后顶，双手向前慢慢往前推，口说“呬”字。然后，双手外旋，掌心向里，逐渐站起来，双手回到胸部约10厘米。重复6次，每天2组。</p><p style=\"text-indent: 2em;\">作用：“呬”字诀能补益肺气、改善肺功能。</p><p style=\"text-indent: 2em;\">两腿分开与肩同宽，双手抬起，两手向后滑成弧形，抚摸到后腰部，然后向下滑慢慢下蹲，嘴说“吹”，两手屈肘向前，虎口相对，逐渐收回起身。重复6次，每天2组。</p><p style=\"text-indent: 2em;\">作用：“吹”字诀可以强腰补肾，泻肾脏之浊气。</p><p style=\"text-indent: 2em;\">口型为两唇微启，舌稍后缩，舌尖向下。呼气念“嘻”字，足四五趾点地。两手自体侧抬起如捧物状，过腹至两乳平，两臂外旋翻转手心向外，并向头部托举，两手心转向上，指尖相对。吸气时五指分开，由头部循身体两侧缓缓落下并以意引气至足四趾端。重复6次，调息。</p><p style=\"text-indent: 2em;\">作用：“嘻”字诀调理由三焦不畅而引起的眩晕、耳鸣、喉痛等疾患。</p><p style=\"text-indent: 2em;\">双脚分开与肩同宽，把手放在腹前约10厘米的位置，缓慢下蹲，手向前撑成圆形，嘴说“呼”，起身恢复站姿，注意呼气时要鼓肚子。重复6次，每天2组。 <br></p><p style=\"text-indent: 2em;\">作用：“呼”字诀能补益脾气、促进胃肠消化。</p>');
INSERT INTO `news` VALUES (8, 'data:image/png;base64,', '2022年06月10日 13:36', '盛夏养生 补水祛暑化湿是关键', '今晚报', '<p>　　芒种节气过后，仲夏将至，气温也会显著升高、降雨增多、空气湿度加大，在这样的自然环境中，如何养生呢？中医一附院治未病健康管理中心主任孙庆从起居、饮食、运动等多方面给市民养生建议。</p><p>　　起居：重视午休</p><p>　　每到夏季，人们很容易感觉懒洋洋的。顺应夏日昼长夜短的特点，可适当晚睡早起，但这里说的“晚睡”并非熬夜。夏天睡眠时间相对减少，而午睡是适当的睡眠补充。“午睡一刻钟，夜补一小时”，既能预防“夏打盹”，还有利于养护心脏，也有助于消除疲劳。中医认为，午睡是养心的好方法。在中午阳气偏盛的时候，通过休息来养阴，达到阴阳调和的目的。特别是患有心血管疾病的中老年人更要注重午睡，但是午睡时间也不宜过长，一般半小时为宜。因为白天睡的时间过长，晚上会睡不着，造成不良循环，反而影响健康。</p><p>　　白天在做好防晒的同时也要适当接受阳光照射，以利于气血运行，振奋精神。为避免“空调病”，空调温度应控制在26至28℃。在开着空调的房间待久了，应定时通风换气，不要在空调房间内吸烟，并且每天至少要到户外活动3至4个小时。年老体弱者、高血压患者，最好不要长时间待在开着空调的房间。</p><p>　　衣着方面，衣衫要勤洗勤换。为避免中暑，要常洗澡，这样可使毛孔通畅，“阳热”易于发泄。但要注意，出汗时不要立即用冷水洗澡，应用温热的水洗澡或擦拭，更不要赤膊贪凉。</p><p>　　饮食：多吃含钾食物</p><p>　　夏季通过饮食防湿邪是个好方法。饮食上以清补为主，健脾、祛暑化湿为原则。夏季对人体最重要的影响是暑湿，暑湿侵入人体后会导致毛孔张开，过多出汗，造成气虚，还会引起脾胃功能失调、消化不良。适当摄入有利于生津止渴、除烦解暑、排毒通便的食物，如黄瓜、西瓜、木耳、薏米等。</p><p>　　同时，随着气温升高，人体在平静状态下，体表的水液流失会悄悄增加。尤其是孩子，要有意识地给孩子多补充水分。同时，可以多吃一些含钾的食物，因为人体内的钾主要是由肾脏代谢，其特点为“多吃多排，少吃少排，不吃也排”。在夏季，汗液的排出会导致钾离子流失，所以在夏季更要有意识地补充钾。含钾量高的食物有荞麦、玉米、红薯、香蕉、海带、菠菜等。</p><p>　　推荐饮用薏仁红豆汤，有清热健脾、利湿养肝的作用。也可自制五味枸杞饮，将五味子和剪碎的枸杞用沸水冲泡，温浸片刻，有滋肾阴、助肾阳，适用于“夏虚”之症。丝瓜粥，丝瓜去皮去瓤，与粳米熬煮，有清热解毒、凉血通络、润肤的作用。</p><p>　　运动：勿直吹空调</p><p>　　在气温高、空气湿度大的环境下，人体内的汗液无法通畅地发散出来，热蒸湿动，可以通过运动促进排汗，增强抵抗力。但是，应避免在烈日暴晒下运动，以免出汗过多，耗气伤津。运动可选择游泳、慢跑、打羽毛球、乒乓球等。运动后要注意，毛孔张开排汗时应避免直吹电扇、空调，不要喝冷饮，以免风寒之邪进入体内。</p>');
